import React from 'react';
import s from './Footer.module.css'

const Footer = () => {
    return (
        <footer className={s.footer}>
            <a href="">
                <img className={s.logo} src="https://coffee-shop.net.ua/media/sun/header/default/logo-top.svg" alt=""/>
            </a>
        </footer>
    );
};

export default Footer;
